var findTheDifference = function (s, t) {
    s = s.split("").sort((a, b) => a.localeCompare(b));
    t = t.split("").sort((a, b) => a.localeCompare(b));
    let i = 0;
    if (s.length == t.length) {
        return;
    }

    if (s.length > t.length) {
        while (i < s.length) {
            if (s[i] != t[i]) {
                return s[i];
            }
            i++;
        }
    } else {
        while (i < t.length) {
            if (s[i] != t[i]) {
                return t[i];
            }
            i++;
        }
    }
};



let s = "",
    t = "";

let result = findTheDifference(s, t);

console.log('result', result);